import React from 'react';
import Feature from '../../components/feature/Feature';
import './whatYTSP.css';

const WhatYTSP = () => (
  <div className="ytsp__whatytsp section__margin" id="wytsp">
    <div className="ytsp__whatytsp-feature">
      <Feature title="How to Download?" text="Click the Download link on the top, then on the latest release, under 'Assets' click to download 'YTSpammerPurge.exe'. (You might have to click Assets to view the files for the release)." />
    </div>
    <div className="ytsp__whatytsp-heading">
      <h1 className="gradient__text">The possibilities of Reporting the Spam</h1>
      <p>Explore the Purpose</p>
    </div>
    <div className="ytsp__whatytsp-container">
      <Feature title="Chatbots" text="We so opinion friends me message as delight. Whole front do of plate heard oh ought." />
      <Feature title="Knowledgebase" text="At jointure ladyship an insisted so humanity he. Friendly bachelor entrance to on by. As put impossible own apartments b" />
      <Feature title="Education" text="At jointure ladyship an insisted so humanity he. Friendly bachelor entrance to on by. As put impossible own apartments b" />
    </div>
  </div>
);

export default WhatYTSP;
